def datasetfinder(request):
  if(request.method == 'POST'):
    name = request.POST['datasetName']
    link =  web_dt_generator(name)
    dicts ={}
    linkname = name+" Dataset"
    if(link != 0):
      dicts[linkname] = link
      result = "Result"
    else:
      dicts = dt_generator(name)
      result = "Results"

    if(len(dicts)==0):
       gen = 'generate_dt'
       trial ="no"
    else:
       gen = "none"
       trial = 'trial'
    dt_links =dicts

    return render(request,'random.html',{'dt_links' :dt_links,'result':result,'trial':trial,'generate_dt':gen})
  
  
def generate_dataset(request):
  datasetName=request.POST['datasetName']
  fileType = request.POST['fileType']
  specialConditions = request.POST['specialConditions']
  attributes = request.POST['attributes']
  NoOfRows = request.POST['NoOfRows']
  get_dataset(datasetName,attributes,fileType,specialConditions,NoOfRows)
  data = pd.read_csv('data.txt')
  dataframe = data.head()
  table_html = dataframe.to_html()
  
  filename = 'file.'+fileType
  data.to_csv(filename, index = None)
  
  
  return render(request,'random.html',{'table_html': table_html,'generated_dataset':"generated_dataset","filename":filename})
  


def download_file(request, filename):
  file_path = os.path.join(settings.BASE_DIR, filename)
  if os.path.exists(file_path):
    with open(file_path, 'rb') as file:
      response = FileResponse(file)
      response['Content-Disposition'] = f'attachment; filename="{filename}"'
      return response
  else:
    raise Http404("File not found")


