def send_message(message):
    response = openai.Completion.create(
        engine='text-davinci-003',
        prompt=message,
        max_tokens=4000,
        temperature=0.7,
        n=1,
        stop=None,
    )
    return response.choices[0].text.strip()


def gt_prompt(name, attributes, file_type, special_conditions, rows) :
    return ('generate a ' + file_type + " " + name + " dataset with attributes " + attributes + " with " + rows + " rows." + special_conditions)

def gt_dataset(prompt) :
    file = open('data.txt','w+')
    print(prompt)
    data = send_message(prompt)
    file.write(data)
    file.close()
    return(file)


def get_dataset(name, attributes, file_type, special_conditions, rows):
  return gt_dataset(gt_prompt(name,attributes,file_type,special_conditions,rows))
  
  
  
  
  
  

def dt_generator(dtname):
    dicts = {}
    # Detect the encoding of the file
    with open('dd.txt', 'rb') as f:
        result = chardet.detect(f.read())
    # Open the file with the detected encoding
    file = open('dd.txt', 'r', encoding=result['encoding'])
    names = []
    dataset_names = []
    for i in file:
        x = i.split("/")
        dataset_names.append(x[1][:-1].replace("-"," "))
        names.append(x[0])
    name = dtname
    nearest_name = difflib.get_close_matches(name,dataset_names)
    if(nearest_name == []):
      return dicts
    else:
      name = nearest_name[0].replace(" ","-")

    dd = {}
    dataset = kaggle.api.datasets_list(search = name)
    
    n = 0
    for i in dataset:
        n = n + 1
        f = i['ref']
        ind = f.find('/')
        dd[n] = f
        name = f'{n}. {f[ind+1:]}'
        link = f'https://www.kaggle.com/datasets/{f}'
        dicts[name] = link
    return dicts
        
        
        
import difflib as df
def get_dataset_from_uci(search_phrase,dict):
    result = df.get_close_matches(search_phrase,dict.keys())
    if result == None:
        return False
    else:
        if search_phrase in result[0]:
            return dict[result[0]]
